import React from 'react';
import {
  View,
  Text,
  StyleSheet,
  ScrollView,
  TouchableOpacity,
  Dimensions,
  SafeAreaView,
  Image,
} from 'react-native';

const { width, height } = Dimensions.get('window');

const HomeScreen = () => {
  const sportsScores = [
    { score: '90', label: 'Esporte' },
    { score: '100', label: 'Esporte' },
    { score: '30', label: 'Esporte' },
  ];

  const attendanceDays = [
    { day: 'seg', present: true },
    { day: 'ter', present: true },
    { day: 'qua', present: false },
    { day: 'qui', present: false },
    { day: 'sex', present: false },
  ];

  const medals = [
    { month: 'Março', image: require('./img/Medalha_2.svg') },
    { month: 'Abril', image: require('./img/Medalha_4.svg') },
    { month: 'Maio', image: require('./img/Medalha_5.svg') },
  ];

  const achievements = [
    { month: 'Março', image: require('./img/Medalha_1.svg') },
    { month: 'Abril', image: require('./img/Medalha_3.svg') },
    { month: 'Maio', image: require('./img/Medalha_6.svg') },
  ];

  return (
    <SafeAreaView style={styles.container}>
      <ScrollView style={styles.scrollView} showsVerticalScrollIndicator={false}>
        {/* Header */}
        <View style={styles.header}>
          <Text style={styles.logo}>Movz</Text>
          <View style={styles.menuIcon}>
            <View style={styles.menuLine} />
            <View style={styles.menuLine} />
            <View style={styles.menuLine} />
          </View>
        </View>

        {/* XP Progress Section */}
        <View style={styles.xpSection}>
          <View style={styles.xpHeader}>
            <Text style={styles.xpTitle}>Seu XP até agora</Text>
            <Text style={styles.xpValue}>2.500</Text>
          </View>
          <View style={styles.progressBarContainer}>
            <View style={styles.progressBarBackground} />
            <View style={styles.progressBarFill} />
          </View>
        </View>

        {/* Sports Score Card */}
        <View style={styles.card}>
          <Text style={styles.cardTitle}>Sua pontuação nos Esportes</Text>
          <View style={styles.sportsContainer}>
            {sportsScores.map((sport, index) => (
              <View key={index} style={styles.sportCard}>
                <View style={styles.chevronShape}>
                  <Text style={styles.sportScore}>{sport.score}</Text>
                </View>
                <Text style={styles.sportLabel}>{sport.label}</Text>
              </View>
            ))}
          </View>
        </View>

        {/* Attendance Card */}
        <View style={styles.card}>
          <Text style={styles.cardTitle}>Presença nas aulas</Text>
          <View style={styles.attendanceContainer}>
            {attendanceDays.map((day, index) => (
              <View key={index} style={styles.dayContainer}>
                <View style={[styles.dayCircle, day.present && styles.dayCirclePresent]}>
                  {day.present && (
                    <View style={styles.checkmark}>
                      <View style={styles.checkmarkOuter} />
                      <View style={styles.checkmarkInner} />
                    </View>
                  )}
                </View>
                <Text style={styles.dayLabel}>{day.day}</Text>
              </View>
            ))}
          </View>
          <Text style={styles.attendanceStreak}>
            Você está a 30 dias sem faltar as aulas
          </Text>
        </View>

        {/* Medals Card */}
        <View style={styles.card}>
          <Text style={styles.cardTitle}>Suas medalhas</Text>
          <View style={styles.medalBanner}>
            {medals.map((medal, index) => (
              <View key={index} style={styles.medalContainer}>
                <Image source={medal.image} style={styles.medalIcon} resizeMode="contain" />
                <Text style={styles.medalMonth}>{medal.month}</Text>
              </View>
            ))}
          </View>
          <TouchableOpacity style={styles.seeMoreButton}>
            <Text style={styles.seeMoreText}>Ver mais</Text>
          </TouchableOpacity>
        </View>

        {/* Achievements Card */}
        <View style={styles.card}>
          <Text style={styles.cardTitle}>Suas conquistas</Text>
          <View style={styles.medalBanner}>
            {achievements.map((achievement, index) => (
              <View key={index} style={styles.medalContainer}>
                <Image source={achievement.image} style={styles.medalIcon} resizeMode="contain" />
                <Text style={styles.medalMonth}>{achievement.month}</Text>
              </View>
            ))}
          </View>
          <TouchableOpacity style={styles.seeMoreButton}>
            <Text style={styles.seeMoreText}>Ver mais</Text>
          </TouchableOpacity>
        </View>
      </ScrollView>
    </SafeAreaView>
  );
};

const styles = StyleSheet.create({
  container: {
    flex: 1,
    backgroundColor: '#E9EEEE',
  },
  scrollView: {
    flex: 1,
    paddingHorizontal: 20,
  },
  header: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    paddingTop: 20,
    paddingBottom: 20,
  },
  logo: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#000',
  },
  menuIcon: {
    width: 39,
    height: 18,
    justifyContent: 'space-between',
  },
  menuLine: {
    width: 39,
    height: 6,
    backgroundColor: '#D9D9D9',
    borderRadius: 3,
  },
  xpSection: {
    marginBottom: 20,
  },
  xpHeader: {
    flexDirection: 'row',
    justifyContent: 'space-between',
    alignItems: 'center',
    marginBottom: 15,
  },
  xpTitle: {
    fontSize: 18,
    fontWeight: '600',
    color: '#111426',
  },
  xpValue: {
    fontSize: 18,
    fontWeight: '600',
    color: '#111426',
  },
  progressBarContainer: {
    position: 'relative',
    height: 12,
  },
  progressBarBackground: {
    position: 'absolute',
    top: 0,
    left: 0,
    right: 0,
    height: 12,
    backgroundColor: '#0B3850',
    borderRadius: 6,
  },
  progressBarFill: {
    position: 'absolute',
    top: 0,
    left: 0,
    width: '44%', // 133/304 * 100
    height: 12,
    backgroundColor: '#2ED4CC',
    borderRadius: 6,
    shadowColor: '#FFFFFF',
    shadowOffset: { width: 11, height: 0 },
    shadowOpacity: 0.32,
    shadowRadius: 12.3,
    elevation: 8,
  },
  card: {
    backgroundColor: '#FFFFFF',
    borderRadius: 10,
    padding: 20,
    marginBottom: 20,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.1,
    shadowRadius: 4,
    elevation: 3,
  },
  cardTitle: {
    fontSize: 18,
    fontWeight: '600',
    color: '#111426',
    textAlign: 'center',
    marginBottom: 20,
  },
  sportsContainer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
  },
  sportCard: {
    alignItems: 'center',
  },
  chevronShape: {
    width: 69,
    height: 92,
    backgroundColor: '#F9BB55',
    borderRadius: 8,
    justifyContent: 'center',
    alignItems: 'center',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 2 },
    shadowOpacity: 0.25,
    shadowRadius: 10,
    elevation: 8,
    marginBottom: 8,
  },
  sportScore: {
    fontSize: 24,
    fontWeight: 'bold',
    color: '#392B2B',
  },
  sportLabel: {
    fontSize: 12,
    color: '#000',
    fontWeight: '500',
  },
  attendanceContainer: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    marginBottom: 20,
  },
  dayContainer: {
    alignItems: 'center',
  },
  dayCircle: {
    width: 11,
    height: 11,
    borderRadius: 5.5,
    backgroundColor: '#D94A3C',
    marginBottom: 5,
    justifyContent: 'center',
    alignItems: 'center',
  },
  dayCirclePresent: {
    backgroundColor: '#D94A3C',
  },
  checkmark: {
    position: 'absolute',
    width: 7,
    height: 7,
    justifyContent: 'center',
    alignItems: 'center',
  },
  checkmarkOuter: {
    width: 7,
    height: 7,
    borderRadius: 3.5,
    borderWidth: 1,
    borderColor: '#FFFFFF',
  },
  checkmarkInner: {
    width: 3,
    height: 3,
    borderRadius: 1.5,
    backgroundColor: '#FFFFFF',
    position: 'absolute',
  },
  dayLabel: {
    fontSize: 12,
    color: '#000',
  },
  attendanceStreak: {
    fontSize: 12,
    color: '#000',
    textAlign: 'center',
  },
  medalBanner: {
    flexDirection: 'row',
    justifyContent: 'space-around',
    alignItems: 'center',
    backgroundColor: '#F9BB55',
    borderRadius: 8,
    paddingVertical: 15,
    marginBottom: 15,
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 1 },
    shadowOpacity: 0.25,
    shadowRadius: 19.7,
    elevation: 8,
  },
  medalContainer: {
    alignItems: 'center',
  },
  medalIcon: {
    width: 39,
    height: 39,
    marginBottom: 8,
    borderRadius: 19.5,
    borderWidth: 1,
    borderColor: '#0B384E',
    shadowColor: '#000',
    shadowOffset: { width: 0, height: 0 },
    shadowOpacity: 0.4,
    shadowRadius: 8,
    elevation: 8,
  },
  medalMonth: {
    fontSize: 12,
    color: '#000',
    fontWeight: '500',
  },
  seeMoreButton: {
    alignItems: 'center',
  },
  seeMoreText: {
    fontSize: 12,
    color: '#6B7280',
  },
});

export default HomeScreen;
